///
///         if fullname != alias:
///             if fullname.startswith('<'):
///                 fullname = fullname[1:]
///                 if not ispkg:
///                     fullname = f'{fullname}.__init__'
///             else:
///                 ispkg = False
///         relfile = fullname.replace('.', sep)
///         if ispkg:
///             pkgdir = f'{sys._stdlib_dir}{sep}{relfile}'
